criteria:
Inclusion Criteria:

  -  Be at least 50 years of age;

  -  Have a diagnosis of probable Alzheimer's Disease;

  -  Have an MMSE score of > or = 10 and < or = 24;

  -  Must have a caregiver who is able to attend all study visits;

  -  Have received continuous treatment with donepezil for at least 6 months prior to
     screening, and received a stable dose of 5 mg/day or 10 mg/day for at least the last 3
     of these 6 months.

Exclusion Criteria:

  -  Have an advanced, severe, progressive, or unstable disease of any type that may
     interfere with efficacy and safety assessments or put the patient at special risk;

  -  Have a history of malignancy of any organ system, treated or untreated, within the
     past 5 years;

  -  Have a history within the past year or current diagnosis of cerebrovascular disease;

  -  Have a current diagnosis of severe or unstable cardiovascular disease; Have a history
     of myocardial infarction (MI) in the last six months;

  -  Severe or unstable respiratory conditions (e.g., severe asthma , severe pulmonary
     (lung) disease);

  -  Digestive problems related to peptic ulcer;

  -  Urinary obstruction or current severe urinary tract infection;

  -  Abnormal thyroid function tests;

  -  Low folate or Vitamin B12;

  -  Have a disability that may prevent the patient from completing all study requirements;

  -  Have a current diagnosis of an active skin lesion/disorder that would prevent adhesion
     of a patch;

Other protocol-defined inclusion/exclusion criteria may apply

Inclusion Criteria:

  -  Symptomatic pulmonary embolism with or without symptomatic deep vein thrombosis

Exclusion Criteria:

  -  End stage renal failure, hepatic failure, uncontrolled hypertension;

  -  Active bleeding or high risk for bleeding;

  -  Pregnancy or childbearing potential without proper contraceptive measures, threatened
     abortion.

  -  Breastfeeding.

  -  Known allergy to idraparinux or idrabiotaparinux, avidin or egg proteins;

  -  hypersensitivity to warfarin, enoxaparin, heparin or pork product; or any other
     contraindication listed in the labelling of warfarin or enoxaparin;

  -  Indication of prolonged anticoagulation therapy for other reason than PE;

  -  Life expectancy < 6 months;

Inclusion Criteria:

  -  Patients with primary RLS, based on the International RLS Study Diagnostic Criteria.

Exclusion Criteria:

  -  A sleep disorder (e.g., sleep apnea) that may significantly affect the assessment of
     RLS;

  -  Neurologic disease or movement disorder (e.g., diabetic neuropathy, Parkinson's
     Disease, Multiple Sclerosis, dyskinesias, and dystonias);

  -  Abnormal laboratory results, electrocardiogram (ECG) or physical findings;

  -  Pregnant or lactating women;

  -  Women of childbearing potential who are not practicing an acceptable method of birth
     control.

Inclusion Criteria:

  -  Patients with primary RLS, based on the International RLS Study Group Diagnostic
     Criteria.

Exclusion Criteria:

  -  A sleep disorder (e.g., sleep apnea) that may significantly affect the assessment of
     RLS;

  -  Neurologic disease or movement disorder (e.g., diabetic neuropathy, Parkinson's
     disease, Multiple Sclerosis, dyskinesias, and dystonias);

  -  Abnormal laboratory results, electrocardiogram (ECG) or physical findings;

  -  Pregnant or lactating women;

  -  Women of childbearing potential who are not practicing an acceptable method of birth
     control.

Inclusion Criteria:

  -  Evidence of atrial fibrillation either on one current Electrocardiogram (ECG) or on
     two ECG recorded at two weeks a part during 6 months prior to study enrollment.

  -  Evidence of high risk of vascular events: at least one of the following risk criteria
     must be present:

       -  are 75 years or greater;

       -  on treatment for systemic hypertension;

       -  prior stroke, TIA, or non-CNS systemic embolus;

       -  left ventricular dysfunction with left ventricular ejection fraction (EF)
          estimated by echocardiogram or angiogram (radionuclide or contrast) to be < 45%;

       -  peripheral vascular disease (previous peripheral artery revascularization, limb
          and foot amputation, or the combination of current intermittent claudication and
          ankle arm systolic blood pressure ratio < 0.9);

       -  age 55 to 74 years; AND

       -  either diabetes mellitus requiring drug therapy, or documented previous
          myocardial infarction, or documented coronary artery disease.

Exclusion Criteria:

  -  Patients will be excluded from ACTIVE if any of the following are present :

       -  requirement for clopidogrel (such as recent coronary stent procedure);

       -  requirement for oral anticoagulant (such as prosthetic mechanical heart valve);

       -  prior intolerance to ASA or clopidogrel;

       -  documented peptic ulcer disease within the previous 6 months;

       -  prior intracerebral hemorrhage;

       -  significant thrombocytopenia; (platelet count < 50 x 10(9)/L);

       -  psychosocial reason making study participation impractical;

       -  geographic reason making study participation impractical;

       -  ongoing alcohol abuse;

       -  mitral stenosis;

       -  pregnant or nursing woman or woman of child bearing potential and not on
          effective birth control for at least one month prior to start of study or not
          willing to continue on birth control for duration of study;

       -  severe comorbid condition such that the patient is not expected to survive 6
          months;

       -  patient currently receiving an investigational pharmacologic agent; OR

       -  requirement for chronic (> 3 months) non-COX-2 inhibitor NSAID therapy.

Inclusion Criteria:

  -  Adult participants 18-80 years of age with active RA for at least 6 months;

  -  Received treatment for RA on an outpatient basis and experienced an inadequate
     response or intolerance to treatment with at least 1 anti-TNF alpha therapy
     (etanercept, infliximab or adalimumab);

  -  Must have received MTX for a minimum of 12 weeks, with the last 4 weeks, prior to
     screening at a stable dose;

  -  Participants with swollen joint count (SJC) and tender joint count (TJC) of at least 8
     joints at screening and at randomization;

  -  Radiographic evidence of at least 1 joint with a definite erosion due to RA;

  -  Participants of reproductive potential must be using reliable contraceptive methods.

Exclusion Criteria:

  -  Bone or joint surgery within 8 weeks prior to screening or joint surgery planned
     within 24 weeks of randomization;

  -  Class IV functional status of RA;

  -  Previous treatment within 6 months with intravenous gamma globulin, or the Prosorba
     column;

  -  Intraarticular or parenteral corticosteroids within 4 weeks prior to screening visit;

  -  With a live vaccine within 4 weeks prior to randomization;

  -  Previous treatment with rituximab or other cell-depleting therapies;

  -  Concurrent treatment with any disease-modifying anti-rheumatic drug (except for MTX)
     or any anti-TNF alfa factor or other biologic therapy;

  -  History of severe allergic or anaphylactic reactions to humanized or murine monoclonal
     antibodies;

  -  Evidence of significant uncontrolled concomitant diseases such as cardiovascular
     disease, nervous system, pulmonary, renal, hepatic, endocrine or gastrointestinal
     disorders;

  -  Known contraindications to receiving rituximab;

  -  Known active bacterial, viral, fungal, mycobacterial or other infection;

  -  History of recurrent significant infection or history of recurrent bacterial
     infections;

  -  Primary or secondary immunodeficiency (history of, or currently active);

  -  History of cancer, including solid tumors and hematologic malignancies (except basal
     cell or squamous cell carcinoma of the skin that have been excised and cured);

  -  Women who are pregnant or breast-feeding;

  -  History of alcohol, drug or chemical abuse within 6 months prior to screening;

  -  Neuropathies and neurovasculopathies which might interfere with pain evaluation;

  -  Participants with poor peripheral venous access;

  -  Intolerance or contraindications to oral or intravenous corticosteroids.

Inclusion Criteria:

  -  adult patients, 18-75 years of age;

  -  type 2 diabetes receiving metformin and/or pioglitazone or rosiglitazone for at least
     12 weeks;

  -  HbA1c >=7.0% and <=10% at screening;

  -  BMI >=25kg/m2 (>23kg/m2 for Asians) and <=45kg/m2 at screening;

  -  stable weight +/- 5% for at least 12 weeks prior to screening.

Exclusion Criteria:

  -  history of type 1 diabetes, diabetes resulting from pancreatic injury or secondary
     forms of diabetes;

  -  history of acute metabolic diabetic complications within the previous 6 months;

  -  evidence of clinically significant diabetic complications;

  -  known proliferative diabetic retinopathy;

  -  myocardial infarction (MI), coronary artery bypass surgery, post-transplantation
     cardiomyopathy (PTCM) or stroke within the past 6 months;

  -  any abnormality in clinical laboratory test or ECG, which precludes safe involvement
     in the study as judged by the investigator;

  -  known hemoglobinopathy or chronic anemia;

  -  clinically significant gastrointestinal disease.

Inclusion Criteria:

  -  Multiple sclerosis [MS] subject who was ambulatory (EDSS of ≤ 5.5)

  -  Exhibiting a relapsing clinical course, with or without progression (relapsing
     remitting, secondary progressive or progressive relapsing);

  -  Meeting McDonald's criteria for MS diagnosis;

  -  Experienced at least 1 relapse over the 1 year preceding the trial or at least 2
     relapses over the 2 years preceding the trial;

  -  No relapse onset in the preceding 60 days prior to randomization;

  -  Clinically stable during the 30 days prior to randomization, without
     adrenocorticotrophic hormone [ACTH] or systemic steroid treatment.

Exclusion Criteria:

  -  Clinically relevant cardiovascular, hepatic, neurological, endocrine or other major
     systemic disease;

  -  Significantly impaired bone marrow function;

  -  Pregnant or nursing woman;

  -  Alcohol or drug abuse;

  -  Use of cladribine, mitoxantrone, or other immunosuppressant agents such as
     azathioprine, cyclophosphamide, cyclosporin, methotrexate or mycophenolate before
     enrollment;

  -  Any known condition or circumstance that would prevent in the investigator's opinion
     compliance or completion of the study;

Inclusion Criteria:

  -  Must have clinical symptoms consistent with AMI (e.g., angina or anginal
     equivalent)lasting >20 minutes but <12 hours in duration;

  -  ST-segment elevation of >1 mm in >2 contiguous leads, or (presumably new) left bundle
     branch block, or true posterior MI with ST depression of >1 mm in >2 contiguous
     anterior leads;

  -  The patient or guardian agrees to the study protocol and the schedule of clinical and
     angiographic follow-up, and provides informed, written consent.

Exclusion Criteria:

  -  The patient has a known hypersensitivity or contraindication to any of the following
     medications:

       -  Heparin, pork or pork products

       -  Both abciximab and eptifibatide

       -  Aspirin

       -  Both Clopidogrel and Ticlopidine

       -  Bivalirudin

       -  Paclitaxel or Taxol

       -  The polymer components of the TAXUS™ stent (SIBS)

       -  Stainless steel and/or

       -  Contrast media;

  -  Prior administration of thrombolytic therapy, bivalirudin, GP IIb/IIIa inhibitors, low
     molecular weight heparin or fondaparinux for this admission. Patients receiving prior
     unfractionated heparin may be enrolled, and treated per randomization;

  -  Current use of coumadin;

  -  Systemic (intravenous) Paclitaxel or Taxol use within 12 months;

  -  Female of childbearing potential, unless a recent pregnancy test is negative, who
     possibly plans to become pregnant any time after enrollment into this study;

  -  History of bleeding diathesis or known coagulopathy (including heparin-induced
     thrombocytopenia), or will refuse blood transfusions;

  -  History of intra-cerebral mass, aneurysm, arteriovenous malformation, or hemorrhagic
     stroke;

  -  Stroke or transient ischemic attack within the past 6 months, or any permanent
     residual neurologic defect;

  -  Gastrointestinal or genitourinary bleeding within the last 2 months, or major surgery
     within six weeks;

  -  Recent history or known current platelet count <100,000 cells/mm3 or Hgb <10 g/dL;

  -  Extensive peripheral vascular disease, such that emergent angiography and intervention
     in the opinion of the investigator is likely to be difficult or complicated;

  -  An elective surgical procedure is planned that would necessitate interruption of
     thienopyridines during the first six months post enrollment;

  -  Non-cardiac co-morbid conditions are present with life expectancy <1 year or that may
     result in protocol non-compliance;

  -  Patients who are actively participating in another drug or device investigational
     study, which have not completed the primary endpoint follow-up period;

  -  Previous enrollment in this trial;

  -  Patients who underwent coronary stent implantation within the past 30 days.
